import React, {Component} from 'react';
import {getQuestions} from '../fonctions/appelleApi';

class AppQuestion extends Component{
    constructor(props){
        super(props)
        this.state={
            listeQuestions:[]
        }

    }

    componentDidMount() {
        this.initQuestions()
    }
    
    componentWillUnmount() {
    }

    initQuestions = () => {
        getQuestions(10).then(data =>{
            this.setState(
                {
                    listeQuestions:data
                }
            )
            console.log(this.state.listeQuestions)
        })
    }

    renderQuestion = () => {
        let {questions} = this.state;
        return (
            <div>
                <section>
                <h1>question</h1>
                </section>
                <button >Question suivante</button>
            </div>
            )
      }

    render(){
        return (
        <div>
          <section>
            {this.renderQuestion()}
          </section>
        </div>
      )
    }
}

export default AppQuestion
